import React from 'react';
import Loader from '../component/Loader/Loader.js';

function About() {
    return (
        <div>
            <main class="scroll-container">
                <section>
                    <h2>Section 1</h2>
                </section>
                <section>
                    <h2>Section 2</h2>
                </section>
                <section>
                    <h2>Section 3</h2>
                </section>
                <section>
                    <h2>Section 4</h2>
                </section>
            </main>
        </div>
    );
}

export default About;
